$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_cb38b2dcd44e20779fe46cf80828dd21'] = 'Kategorie, do kterých produkt patří (zobrazí se podobně jako drobečková navigace: \"Oblečení | Dámské | Léto | Plavky\". Jako oddělovač můžete zadat i jiný znak, např.:';
