$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_da4e8bf09b73e2e89d7840dff8937483'] = 'URL obrázku produktu';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_2ea0456a6f9bccc61ab963ad6a296bdf'] = 'Stav produktu (new, used, refurbished). Můžete použít ve feedu i vlastní hodnoty: doplňte je za dvojtečku, hodnoty oddělujte čárkou a zadávejte v pořadí pro \"nový\", \"výprodej\" a \"repasovaný produkt\", např.:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_8dd3a6073e19159c177e662702b26fd5'] = 'Cena s DPH jako desetinné číslo (např. \"25.50\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_4ca1a9c0da5d566b77b78207836f59dc'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny (např. \"25.50 Kč\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_16890ccfa0e5d375917818053642a9ec'] = 'Cena s DPH jako desetinné číslo, včetně zkratky měny podle ISO-4217 (např. \"25.50 CZK\")';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_fb51157da1cc9b86aab666c680d53ff7'] = 'Jestli je produkt dostupný jen v eshopu (= 1), nebo i v kamenné prodejně (= 0).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5a5274f417de7192893bf24fce20cf41'] = 'Datum a čas (v GMT), kdy byl produkt naposled změněn. Výchozí formát je pro Atom 1.0 (např. \"2012-12-08T14:29:57+00:00\"), ale můžete zvolit vlastní (význam jednotlivých znaků viz PHP funkce date). Příklad vlastního formátu:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_a6089fced12c375180d1e82cc545555d'] = 'Datum a čas, kdy byl feed vytvořen (v GMT). Stejně jako u předchozího můžete použít vlastní formát.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_b4d52fe2c5ba7a3ca39c201a6210eda7'] = 'Kód jazyka, v němž je tento feed (např. \"en-us\" pro angličtinu).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_63d5d01e19c7c2bb90cac3c37a6db053'] = 'Dvoupísmenový kód jazyka podle ISO 639-1 (např. \"en\" pro angličtinu).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_a2732b3fec8c6c97c57d823905e2883d'] = 'Dostupnost produktů';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_53592d9b737443c24389abef4961f9d9'] = 'Pro dostupnost produktů máte k dispozici dvě proměnné: \"days\" a \"availability\". Obě se řídí tím, jestli je produkt skladem a jestli je dostupný pro objednávky (viz nastavení \"Dostupné pro objednávky\" na kartě Informace u editace produktu). Jestli jste u produktu zadali text, který se zobrazuje ve vašem obchodě (front office) podle toho, jestli produkt je / není skladem / lze objednat (viz karta Množství), mohou použít hodnoty z těchto textů. \"Days\" má jednodušší zpracování, použije se první číslo, které najde. Proměnná \"availability\" umí rozlišovat čísla (počet dní pro dodání) a data (např. od kdy bude produkt dostupný). Také si můžete nastavit různé vlastní hodnoty pro dostupnost, např. skladem / na objednávku / vyprodáno.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f5c5cd16cec652fe7436c4de79c1da2a'] = 'Pokud je produkt skladem, vloží do feedu buď první číslo z textu, který se zobrazuje ve vašem obchodě u produktů skladem nebo nulu. Pokud produkt není skladem a u produktu jste nenastavili žádný text, nevrátí žádnou hodnotu. Potom záleží na nastavení tohoto feedu, jestli v XML smí být prázdný tag nebo ne.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_25ba837bddb2f3631c83835c25413539'] = 'Tato proměnná umožňuje (podobně jako {condition}) zadat různé vlastní hodnoty. Výchozí funkčnost je tato: u produktů, které jsou skladem, vloží stejné číslo jako {days}. Totéž u produktů, které nejsou skladem, ale je možné je objednat. Nedostupné produkty se do feedu vůbec nevloží.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_94bfc6175ca9ff03c8dd81b2b84d36e6'] = 'Možnosti přizpůsobení: vlastní hodnoty se zadávají v pořadí \"skladem\", \"na objednávku\" a \"vyprodané\". Neměly by ale začínat mřížkou, ta je vyhrazena pro speciální hodnoty. Za čárkami můžete pro lepší čitelnost nechávat mezery.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_6735daaa03ec6159a7e149c759151976'] = 'Příklady:';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5dcd5bd6efd565fb40194d7a757ba21e'] = 'Vloží se zadané texty, do feedu se přidají i nedostupné produkty.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_f3c3edc5d26954cd58c7c8c9015eaf0a'] = 'U produktů skladem se vloží číslo. U produktů na objednávku buď číslo, anebo datum zformátované podle zadání (viz PHP funkce date). Výchozí chování pro nedostupné produkty se nebude měnit, takže jej lze vynechat.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_e2ffb990947557f75e57b795aa17f665'] = 'Pokud chcete u produktů skladem ještě rozlišovat podle dodací lhůty, zadejte počet dní, hodnotu pokud je dostupnost menší nebo rovna počtu dní a hodnotu pro pozdější dostupnost, oddělujte dvojtečkou. Podle tohoto příkladu se u produktů skladem, které budou odeslány do tří dnů vloží hodnota \"immediately\" (ihned), u ostatních produktů skladem se vloží \"expected product\" (očekávany produkt). U produktů na objednávku se vloží číslo/datum.';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5666e288aa6a0d6b71f037d1f52dac83'] = 'U produktů skladem se vloží číslo, u produktů na objednávku číslo nebo datum, nedostupné produkty se do feedu vůbec nepřidají (toto jsou výchozí hodnoty).';
$_MODULE['<{prestacenterxmlexportfree}prestashop>feedlegend_5dcdf642d65c6dbad40e438c744e1ae7'] = 'Nastavení pro Nákupy Google (Google Merchant Center): U produktů, které budou odeslány do tří dnů včetně, se vloží \"in stock\", u ostatních produktů skladem \"available for order\". U produktů, které nejsou skladem, ale jsou povoleny objednávky, se vloží \"preorder\". U nedostupných produktů se vloží \"out of stock\".';
